import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";




function App () {
    console.log(notes[1].title);
    return(
        <div>
        <Header/>
        {notes.map((noteItem) => {
return(
<Note
        key={noteItem.key}
        title={noteItem.title}
        content={noteItem.content}
        />
);
}

)}
        <Footer/>
        </div>
    );
    
}

export default App;




